// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./ERC223/IERC223.sol";
import "./ERC223/IERC223Recipient.sol";
import "./TokenTax.sol";
import "./utils/Address.sol";
import "./LockBalance.sol";

contract FavorTube is IERC223Recipient, TokenTax, Ownable, LockBalance {

    event $subscribe(address owner, address licensee, uint32 expire);

    address private _token;

    uint256 private _defaultPrice;

    mapping(address => uint256) private _defaultUserPrice;

    constructor(uint8 taxRate, uint256 price, address ERC223Token, uint interval) TokenTax(taxRate) LockBalance(interval) {
        require(Address.isContract(ERC223Token));
        _token = ERC223Token;

        _defaultPrice = price;
    }

    //    -------------------------
    function lock(address addr, uint amount) internal override {
        _lock(addr, amount);
    }

    function setPeriodData(uint value) external override onlyOwner {
        _setPeriodData(value);
    }

    function exchange() external override {
        uint amount = super.exchangeableAmount();
        require(amount != 0, "Insufficient balance");
        require(IERC223(_token).transfer(_msgSender(), amount), "Withdrawal Failure");
        _exchange(_msgSender(), amount);
    }

    //    -------------------------

    function defaultPrice() public view returns (uint256 price) {
        return defaultPrice(_msgSender());
    }

    function tokenReceived(address _from, uint _value, bytes memory _data) public override {

        require(_msgSender() == _token, 'Incorrect contract address');

        address owner;
        uint32 interval;

        (owner, interval) = decodeCallbackData(_data);

        if (_value < defaultPrice(owner))
            revert("paid price is too low");

        uint remainValue = payTax(_value);

        lock(owner, remainValue);

        uint32 expire = computeExpire(interval);

        emit $subscribe(owner, _from, expire);
    }

    function setTaxRate(uint8 newRate) public override onlyOwner returns (bool success) {
        return super.setTaxRate(newRate);
    }

    function withdrawTax(address account, uint value) public override onlyOwner returns (bool success) {
        require(_totalTaxes >= value);

        _totalTaxes -= value;

        return IERC223(_token).transfer(account, value);
    }

    function setDefaultPrice(uint256 price) public onlyOwner {
        _defaultPrice = price;
    }

    function setUserPrice(uint256 price) public {
        _defaultUserPrice[_msgSender()] = price;
    }

    function decodeCallbackData(bytes memory data) internal pure returns (
        address _owner,
        uint32 _blocks
    ) {
        return abi.decode(data, (address, uint32));
    }

    function defaultPrice(address account) internal view returns (uint256 price) {
        price = _defaultUserPrice[account];

        if (price == 0)
            return _defaultPrice;

        return price;
    }

    function computeExpire(uint32 value) internal view returns (uint32) {
        uint result = uint(value) + block.number;

        if (result >= uint(type(uint32).max)) {
            return type(uint32).max;
        }

        return uint32(result);
    }

    function payTax(uint value) internal override returns (uint taxed) {
        uint taxes = (_taxRate * value) / 100;
        uint remain = (value * (100 - _taxRate)) / 100;

        require(remain > 0, "value less then zero after taxed");

        _totalTaxes += taxes;

        return remain;
    }
}
